class Solution {

    /**
     * @param String $s
     * @return Integer
     */
    function minimumBeautifulSubstrings($s) {
        $cache = [];
        $dp = array_fill(0, strlen($s) + 1, PHP_INT_MAX);
        $dp[0] = 0;
        for ($i = 1; $i <= strlen($s); $i++) {
            if ($s[$i - 1] == '0') continue;
            $num = 0;
            for ($j = $i; $j <= strlen($s); $j++) {
                $num = $num * 2 + $s[$j - 1] - '0';
                if ($num > pow(5, floor(log(pow(2, 15), 5)))) break;
                if (isset($cache[$num]) || $num == pow(5, floor(log($num, 5)))) {
                    $cache[$num] = true;
                    $dp[$j] = min($dp[$j], $dp[$i - 1] + 1);
                }
            }
        }
        return $dp[strlen($s)] == PHP_INT_MAX ? -1 : $dp[strlen($s)];
    }
}
